import React from 'react';
import './Help.css';

function Help() {
  return (
    <>
      <div className="help-container-bg"></div>
      <div className="help-container">
        <h2>Ajutor & Instrucțiuni</h2>
        <ol>
          <li><b>Creare cont:</b> Apasă pe butonul "Create Account" de pe pagina principală și completează formularul cu datele tale.</li>
          <li><b>Autentificare:</b> Dacă ai deja cont, apasă pe "Log in" și introdu datele de conectare.</li>
          <li><b>Desenare grafuri/diagrame:</b> După autentificare, vei avea acces la editorul de grafuri, diagrame UML, rețele Petri și automate.</li>
          <li><b>Export SVG:</b> Poți salva/descarca desenul tău în format SVG pentru a-l folosi în alte aplicații sau pe web.</li>
          <li><b>Ajutor suplimentar:</b> Pentru întrebări sau probleme, folosește această pagină sau contactează administratorul aplicației.</li>
        </ol>
      </div>
    </>
  );
}

export default Help;
